package server.result;

import server.model.game.ai.AIList;

/**
 * The result generated by requesting a list of the AI through the AI end point.
 */
public class ListAIResult implements IResult {

    private AIList aiList;

    public ListAIResult(AIList aiList) {
        this.aiList = aiList;
    }

    @Override
    public Object getResult() {
        return aiList;
    }

    @Override
    public void setResult(Object aiList) {
        this.aiList = (AIList)aiList;
    }
}
